(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-019435b4"],{"175a":function(a,e,t){"use strict";t("4dab")},"4dab":function(a,e,t){},"67df":function(a,e,t){"use strict";t.r(e);var s=t("7a23"),n=t("74de"),o=t.n(n),r={class:"introduce-wrap"},i=Object(s["createStaticVNode"])('<h1 class="title" data-v-3f103623>Introduce</h1><p class="desc" data-v-3f103623> Arctic is a LakeHouse management system under open architecture, which on top of data lake open formats provides more optimizations for streaming and upsert scenarios, as well as a set of pluggable self-optimizing mechanisms and management services. Using Arctic could help various data platforms, tools and products build out-of-the-box, streaming and batch unified LakeHouses quickly. </p><h2 class="sub-title" data-v-3f103623>What is arctic</h2><p class="desc" data-v-3f103623> Currently, Arctic is a LakeHouse management system on top of iceberg format. Benefit from the thriving ecology of Apache Iceberg, Arctic could be used on kinds of data lakes on premise or clouds with varities of engines. Several concepts should be known before your deeper steps: </p><img src="'+o.a+'" alt="" class="arctic-introduce" data-v-3f103623><div class="desc" data-v-3f103623><ol data-v-3f103623><li data-v-3f103623>AMS and optimizers - Arctic Management Service provides management features including self-optimizing mechanisms running on optimizers, which could be scaled as demand and scheduled on different platforms.</li><li data-v-3f103623>Mutiple formats — Arctic use formats analogous to MySQL or ClickHouse using storage engines to meet different scenarios. Two formats were available since Arctic v0.4. <div data-v-3f103623><p data-v-3f103623><span class="dot" data-v-3f103623></span>Iceberg format — learn more about iceberg format details and usage with different engines: <a href="https://iceberg.apache.org/docs/latest/" target="_blank" rel="noopener noreferrer" data-v-3f103623> Iceberg Docs </a></p><p data-v-3f103623><span class="dot" data-v-3f103623></span>Mixed streaming format - if you are interested in advanced features like auto-bucket, logstore, hive compatible, strict PK constraints etc. learn Arctic <a href="https://arctic.netease.com/ch/concepts/table-formats/#mixed-iceberg-format" target="_blank" rel="noopener noreferrer" data-v-3f103623> Mixed Iceberg format </a> and <a href="https://arctic.netease.com/ch/concepts/table-formats/#mixed-hive-format" target="_blank" rel="noopener noreferrer" data-v-3f103623> Mixed Hive format </a></p></div></li></ol></div><h2 class="sub-title" data-v-3f103623>Arctic features</h2><ol data-v-3f103623><li data-v-3f103623>Defining keys - supports defining primary key with strict constraints, and more types of keys in future</li><li data-v-3f103623>Self-optimizing - user-insensitive asynchronous self-optimization mechanisms could keep lakehouse fresh and healthy</li><li data-v-3f103623>Management features - dashboard UI to support catalog/table management, SQL terminal and all kinds of metrics </li><li data-v-3f103623>Formats compatible - Hive/Iceberg format compatible means writing and reading through native Hive/Iceberg connector</li><li data-v-3f103623>Better data pipeline SLA - using LogStore like kafka to accelarate streaming data pipeline to ms/s latency</li><li data-v-3f103623>Better OLAP performace - provides auto-bucket feature for better compaction and merge-on-read performance</li><li data-v-3f103623>Concurrent conflicts resovling - Flink or Spark could concurrent write data without worring about conflicts</li></ol><h2 class="sub-title" data-v-3f103623>Engines supported</h2><p class="desc" data-v-3f103623>Arctic support multiple processing engines as below:</p><table class="table" data-v-3f103623><thead class="ant-table-thead" data-v-3f103623><tr data-v-3f103623><th data-v-3f103623>Processing Engine</th><th data-v-3f103623>Version</th></tr></thead><tbody class="ant-table-tbody" data-v-3f103623><tr data-v-3f103623><td data-v-3f103623><span class="td-val" data-v-3f103623>Flink</span></td><td data-v-3f103623><span class="td-val" data-v-3f103623>1.12.x,1.14.x and 1.15.x</span></td></tr><tr data-v-3f103623><td data-v-3f103623><span class="td-val" data-v-3f103623>Spark</span></td><td data-v-3f103623><span class="td-val" data-v-3f103623>2.3, 3.1</span></td></tr><tr data-v-3f103623><td data-v-3f103623><span class="td-val" data-v-3f103623>Trino</span></td><td data-v-3f103623><span class="td-val" data-v-3f103623>380</span></td></tr></tbody></table><h2 class="sub-title" data-v-3f103623>Quickstart</h2><p class="desc" data-v-3f103623> Visit <a href="https://arctic.netease.com/ch/quickstart/quick-demo/" target="_blank" rel="noopener noreferrer" data-v-3f103623> https://arctic.netease.com/ch/quickstart/quick-demo/ </a> to quickly explore what arctic can do. </p><h2 class="sub-title" data-v-3f103623>Join Community</h2><p class="desc" data-v-3f103623>If you are interested in Lakehouse, Data Lake Format, welcome to join our community, we welcome any organizations, teams and individuals to grow together, and sincerely hope to help users better use Data Lake Format through open source.</p><p class="desc" data-v-3f103623>Join the Arctic WeChat Group: Add &quot; <code data-v-3f103623>kllnn999</code> &quot; as a friend on WeChat and specify &quot;Arctic lover&quot;.</p>',16),c=[i];function d(a,e,t,n,o,i){return Object(s["openBlock"])(),Object(s["createElementBlock"])("div",r,c)}var l=Object(s["defineComponent"])({name:"Introduce",components:{},setup:function(){return Object(s["onMounted"])((function(){})),{}}}),f=(t("175a"),t("6b0d")),p=t.n(f);const u=p()(l,[["render",d],["__scopeId","data-v-3f103623"]]);e["default"]=u},"74de":function(a,e,t){a.exports=t.p+"img/introduce_arctic.18809060.png"}}]);